import React from "react";
import { connect } from "react-redux";
const MyCart = ({list}) =>{
    console.log("this is list " +list );
    return(
        <div>
            <ul>
                
                    {list && list.map((item,i)=>(
                        <li className="book">
                            <div className="card">
                                {item.name}
                            </div>    
                        </li>
                    ))}
                    
                
            </ul>
        </div>
    )
}

const mapStateToProps = state =>({
    list:state.cartreducer
    
})
export default connect(mapStateToProps)(MyCart);
